import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = function() {
  return ( 
    <div className="App"> 
      <ul>
        <li>
          css
        </li>
        <li>
          html
        </li>
        <li>
          js
        </li>
        <li>
          react
        </li>
      </ul>
    </div> 
  );
}

const Header = function() {
  return ( 
    <div className="Header"> 
        <a>
          css
        </a>
        <a>
          html
        </a>
        <a>
          js
        </a>
        <a>
          react
        </a>
    </div> 
  );
}

export default App;
